	var player = hypeDocument.getElementById("player");
	var playerLeft = hypeDocument.getElementProperty(player, "left");
	var playerTop = hypeDocument.getElementProperty(player, "top");
	var target = hypeDocument.getElementById('target');

	// Listening to Release event
	if(event['hypeGesturePhase'] == hypeDocument.kHypeGesturePhaseEnd) {

		// reset sling timeline
		hypeDocument.goToTimeInTimelineNamed(0, "sling"); 

		// Get initial values from data store
		var initialX = hypeDocument.dataStore.player.left;
		var initialY = hypeDocument.dataStore.player.top;

		// Calculate distance and velocity
		// Comparing current position to initial values from data store
